import { StyleSheet, Text, View } from 'react-native'
import React from 'react'
import { createBottomTabNavigator } from '@react-navigation/bottom-tabs';
import Home from '../screens/Home';
import Ads from '../components/Ads/Ads';
import Search from '../components/Search/Search';
import { Entypo } from '@expo/vector-icons';


const Tab = createBottomTabNavigator();

const BottomTab = () => {
    return (
        <Tab.Navigator
            screenOptions={{
                headerShown: false,
                tabBarActiveTintColor: '#EC5668',
                tabBarShowLabel: false,
                tabBarInactiveTintColor: 'A4A4A4'
            }}
        >
            <Tab.Screen
                options={{ tabBarIcon: (color, size) => <Entypo name="home" size={24} color={color} /> }}
                name="Home"
                component={Home}
            />
            <Tab.Screen 
            options={{ tabBarIcon: (color, size) => <Entypo name="home" size={24} color={color} /> }} 
            name="Cart" 
            component={Ads} />
            <Tab.Screen options={{ tabBarIcon: (color, size) => <Entypo name="home" size={24} color={color} /> }} name="Profile" component={Search} />
        </Tab.Navigator>
    )
}

export default BottomTab

const s = StyleSheet.create({})
